import React from "react";
import {
   Router,
  Route, Routes
} from "react-router-dom";
import Building from "./views/building/buildingView";
import './App.css';


function App() {
  return (
    <Routes>
          <Router exact path="/getBuildings" component={Building} />
    </Routes>

  );
}

export default App;
